import NavLink from "./NavLink"
const Header = () => {
    return (
        <header>
            <NavLink section={"About"}/>
            <NavLink section={"Experience"}/>
            <NavLink section={"Projects"}/>
            <NavLink section={"Skills"}/>
            <NavLink section={"Interests"}/>
        </header>
    )
}

export default Header
